import React from 'react'
import axios from "axios";



export const login_Api =(formData)=>{

    return async()=>{
        let url = process.env.REACT_APP_API_BASE_URL+"/authetication" ;
        const res = await axios.post(url ,formData)

        return res.data;
    }
}

export const getContactList=()=>{
    return async ()=>{
        let url = process.env.REACT_APP_API_BASE_URL+"/authetication" ;
    }
}
